//Variables
// ------------------------------------------------------------------------------------------------------
var view;
var imgCounter = 1;
var angles = {};
var scales = {};
var touchPointArrayForMagazine = Array();
var markColors = {
    '#ff0000': true,
    '#336699': true,
    '#00ff00': true,
    '#ffcc00': true,
    '#660099': true
};
var minScale = 0.5;
var maxScale = 8.0;
var lastUserInteraction = {};
var imageList = Array();
var backgroundList = Array();
var currSlide;
var slideCount;
var swipeSlideAmount = 1;
var targetImage;
var pageCount = 2;
var swiped = false;
var mouseSize = 32;
// ------------------------------------------------------------------------------------------------------

function init() {
    // Binding some Handlers
    // ------------------------------------------------------------------------------------------------------
    window.addEventListener('contextmenu', function(e) {
        e.preventDefault();
    });
    document.addEventListener('touchstart', function(e) {
        e.stopImmediatePropagation();
    }, false);
    document.addEventListener('touchmove', function(e) {
        e.stopImmediatePropagation();
    }, false);
    document.getElementById('magazine').addEventListener('touchstart', function(e) {
        swiped = false;
    }, false);
    document.getElementById('magazine').addEventListener('touchmove', swipeHandler, false);
    document.getElementById('magazine').addEventListener('touchend', function(e) {
        touchPointArrayForMagazine = Array();
    }, false);

    // ------------------------------------------------------------------------------------------------------

    //Initialize Magazine with Handlers
    // ------------------------------------------------------------------------------------------------------
    $(window).ready(function() {
        $('#magazine').turn({
            display: 'double',
            acceleration: true,
            gradients: !$.isTouch,
            elevation: 50,
            width: 900,
            height: 650,
            autoCenter: true,
            when: {
                turned: function(e, page) {

                    view = $(this).turn('view');
                }
            }
        });
    });

    $(window).bind('keydown', function(e) {

        if (e.keyCode == 37)
            $('#magazine').turn('previous');
        else if (e.keyCode == 39)
            $('#magazine').turn('next');

    });
    view = $('#magazine').turn('view');

    // ------------------------------------------------------------------------------------------------------


    // Binding handlers to image class to make them interactable
    // ------------------------------------------------------------------------------------------------------
    interact('.images')
        .gesturable({
            onstart: function(event) {
                var target = event.target;
                markImageAsSelected('touch', target);
            },
            onmove: function(event) {
                var target = event.target;
                var targetId = target.id
                angles[targetId] = (angles[targetId] + event.da);
                event.target.style.webkitTransform =
                    event.target.style.transform =
                    scales[targetId] = scales[targetId] * (1 + event.ds);
                event.target.style.webkitTransform =
                    event.target.style.transform =
                    'rotate(' + angles[targetId] + 'deg) scale(' + scales[targetId] + ')';

            },
            onend: function(event) {
                var target = event.target;
                unMarkImageAsSelected2d('touch', target);
            }
        })
        .draggable({
            // enable inertial throwing
            inertia: true,
            // keep the element within the area of it's parent
            restrict: {
                restriction: "parent",
                endOnly: true,
                elementRect: {
                    top: 0,
                    left: 0,
                    bottom: 1,
                    right: 1
                }
            },

            onstart: function(event) {
                var target = event.target;
                var magazine = document.getElementById('magazine');
                var magazineDimensions = magazine.getBoundingClientRect();
                markImageAsSelected('touch', target);
                var parent = target.parentNode;
                document.getElementById('interfaceWrapper').appendChild(target);
                if (parent == document.getElementById(view[0])) {
                    target.style.left = (parseInt(target.style.left) + magazineDimensions.left) + 'px';
                    target.style.top = (parseInt(target.style.top) + magazineDimensions.top) + 'px';
                }
                if (parent == document.getElementById(view[1])) {
                    target.style.left = (parseInt(target.style.left) + magazineDimensions.left + parseInt(magazine.style.width) / 2) + 'px';
                    target.style.top = (parseInt(target.style.top) + magazineDimensions.top) + 'px';
                }
            },
            // call this function on every dragmove event
            onmove: function(event) {
                var target = event.target;
                // move the element
                target.style.left = (parseInt(target.style.left) + event.dx) + 'px';
                target.style.top = (parseInt(target.style.top) + event.dy) + 'px';
            },
            onend: function(event) {
                var target = event.target;
                var targetDimensions = event.target.getBoundingClientRect();
                var magazine = document.getElementById('magazine');
                var magazineDimensions = magazine.getBoundingClientRect();
                unMarkImageAsSelected2d('touch', target);
                var touchEndX = event.x0 + event.dx;
                var touchEndY = event.y0 + event.dy;
                var carousel = document.getElementById('sliderWrapper');
                var carouselDimensions = carousel.getBoundingClientRect();
                var deletionArea = document.getElementById('deletionAreaWrapper');
                var deletionAreaDimensions = deletionArea.getBoundingClientRect();
                if (document.getElementById(view[0]) != null &&
                    parseInt(targetDimensions.left) > magazineDimensions.left &&
                    parseInt(targetDimensions.left) < (magazineDimensions.left + (parseInt(magazine.style.width) / 2) - parseInt(targetDimensions.width)) &&
                    parseInt(targetDimensions.top) < (magazineDimensions.top + parseInt(magazine.style.height) - parseInt(targetDimensions.height)) &&
                    parseInt(targetDimensions.top) > magazineDimensions.top) {
                    target.style.left = parseInt(target.style.left) - magazineDimensions.left + 'px';
                    target.style.top = parseInt(target.style.top) - magazineDimensions.top + 'px';
                    document.getElementById(view[0]).appendChild(target);
                } else if (document.getElementById(view[1]) != null &&
                    (parseInt(targetDimensions.left) > (magazineDimensions.left + parseInt(magazine.style.width) / 2)) &&
                    parseInt(targetDimensions.left) < (magazineDimensions.left + parseInt(magazine.style.width) - parseInt(targetDimensions.width)) &&
                    parseInt(targetDimensions.top) < (magazineDimensions.top + parseInt(magazine.style.height) - parseInt(targetDimensions.height)) &&
                    parseInt(targetDimensions.top) > magazineDimensions.top) {
                    target.style.left = (parseInt(target.style.left) - (magazineDimensions.left + (parseInt(magazine.style.width) / 2))) + 'px';
                    target.style.top = (parseInt(target.style.top) - magazineDimensions.top) + 'px';
                    document.getElementById(view[1]).appendChild(target);
                } else if (touchEndX > carouselDimensions.left &&
                    touchEndX < carouselDimensions.left + parseInt(carouselDimensions.width) &&
                    touchEndY > carouselDimensions.top &&
                    touchEndY < carouselDimensions.top + parseInt(carouselDimensions.height)) {
                    document.getElementById('interfaceWrapper').removeChild(event.target);
                    addImage(event.target.id);
                } else if (touchEndX > deletionAreaDimensions.left &&
                    touchEndX < deletionAreaDimensions.left + parseInt(deletionAreaDimensions.width) &&
                    touchEndY > deletionAreaDimensions.top &&
                    touchEndY < deletionAreaDimensions.top + parseInt(deletionAreaDimensions.height)) {
                    deleteFile(target.id);
                    document.getElementById('interfaceWrapper').removeChild(target);
                } else {
                    document.getElementById('interfaceWrapper').appendChild(target);


                }
            }

        });
    // ------------------------------------------------------------------------------------------------------

    // Initialize Image Slider with handlers
    // ------------------------------------------------------------------------------------------------------
    $('.imageSlider').slick({
        prevArrow: $('.prev'),
        nextArrow: $('.next'),
        slidesToScroll: 1,
        slidesToShow: 4,
        infinite: true,
        centerMode: false,
        arrows: false,
        vertical: true,
    });

    $('.prev').click(function() {
        $('.imageSlider').slick('slickPrev');
    })

    $('.next').click(function() {
        $('.imageSlider').slick('slickNext');
    })

    $('.imageSlider').on('init reInit beforeChange afterChange', function(event, slick, currentSlide, nextSlide) {
        currSlide = parseInt($('.slick-current').attr('data-slick-index'));
        slideCount = parseInt(slick.slideCount);
    });
    $('.imageSlider').on('touchstart', function(event) {
    	        $('.imageSlider').slick('refresh');
    	$('.imageSlider').slick('refresh');
        var image = event.target;
        var imageId = $(event.target.parentNode).attr('data-slick-index');
        var imageDimensions = image.getBoundingClientRect();

        $('.imageSlider').slick('slickRemove', imageId);
        image.style.position = 'absolute';
        image.style.left = imageDimensions.left + 'px';
        image.style.top = imageDimensions.top + 'px';
        image.style.zIndex = 15;
        document.getElementById('interfaceWrapper').appendChild(image);
    });

    $('.imageSlider').on('mousedown', function(event) {
        var image = event.target;
        var imageId = $(event.target.parentNode).attr('data-slick-index');
        if($(event.target.parentNode).hasClass('slick-cloned')){
        	imageId = 0;
        	image.id = $("[data-slick-index=0]")[0].firstChild.id;
        	console.log(image)
        }
        var imageDimensions = image.getBoundingClientRect();
console.log(imageId)
        $('.imageSlider').slick('slickRemove', imageId).slick('refresh').slick('setPosition');;
        image.style.position = 'absolute';
        image.style.left = imageDimensions.left + 'px';
        image.style.top = imageDimensions.top + 'px';
        image.style.zIndex = 15;
        document.getElementById('interfaceWrapper').appendChild(image);
    });
    // ------------------------------------------------------------------------------------------------------

    // Interval Functions
    // ------------------------------------------------------------------------------------------------------
    // Checks if every user is still active
    var checkUser = setInterval(function() {
        for (var i = Object.keys(lastUserInteraction).length; i >= 0; i--) {
            var d = new Date();
            if (d.getTime() - lastUserInteraction[Object.keys(lastUserInteraction)[i]] > 2000) {
            	hideMouse(Object.keys(lastUserInteraction)[i]);
            }
        }
    }, 2000);

    // Checks if there are new images in folder to display
    var checkImages = setInterval(function() {
        var url = 'checkImage.php';
        var xhr = new XMLHttpRequest();
        var fd = new FormData();
        xhr.open('POST', url, true);
        xhr.onreadystatechange = function() {
            if (xhr.readyState == 4 && xhr.status == 200) {
                // Every thing ok, file uploaded
                var imagesOnServer = xhr.responseText.split(';');
                for (i = 0; i < imagesOnServer.length; i++) {
                    if (!imageList.includes(imagesOnServer[i])) {
                        addImage(imagesOnServer[i]);
                        imageList.push(imagesOnServer[i]);
                    }
                }
            }
        };
        xhr.send(fd);
    }, 1000);

    // Checks if there are new backgrounds in folder to display
    var checkBackgrounds = setInterval(function() {
        var url = 'checkBackground.php';
        var xhr = new XMLHttpRequest();
        var fd = new FormData();
        xhr.open('POST', url, true);
        xhr.onreadystatechange = function() {
            if (xhr.readyState == 4 && xhr.status == 200) {
                // Every thing ok, file uploaded
                var backgroundsOnServer = xhr.responseText.split(';');
                for (i = 0; i < backgroundsOnServer.length; i++) {
                    if (!backgroundList.includes(backgroundsOnServer[i])) {
                        addBackground(backgroundsOnServer[i]);
                        backgroundList.push(backgroundsOnServer[i]);
                    }
                }
            }
        };
        xhr.send(fd);
    }, 1000);
}

// ------------------------------------------------------------------------------------------------------


//updates the canvas every time a new event is being received
// ------------------------------------------------------------------------------------------------------
function updateGUI(event) {
    var userId = event.skeletonId;
    if (event instanceof JSelectionGesture) {
        selectImage(userId, event.x, event.y);
    }
    if (event instanceof JTransformGesture) {
        transformImage(userId, event.scale, event.angle, event.rotation, event.phase);
    }
    if (event instanceof JSwipeGesture) {
        swipeTo(userId, event.direction);
    }
    if (event instanceof JMoveGesture) {
        moveMouse(userId, event.x, event.y);
    }
    if (event instanceof JDragGesture) {
        dragMoveMouse(userId, event.x, event.y, event.phase);
    }
}
// ------------------------------------------------------------------------------------------------------

// Functions that are triggered by 3D gestures
// ------------------------------------------------------------------------------------------------------

// selects the selected image at x,y
function selectImage(userId, x, y) {
    var images = document.getElementsByClassName('images');
    var i;
    var found = false;
    for (i = 0; i < images.length; i++) {
        var targetDimensions = (images[i]).getBoundingClientRect();
        if (x > (parseInt(targetDimensions.left)) &&
            x < (parseInt(targetDimensions.left) + (parseInt(targetDimensions.width))) &&
            y < (parseInt(targetDimensions.top) + (parseInt(targetDimensions.height))) &&
            y > (parseInt(targetDimensions.top)) &&
            (images[i].parentNode == document.getElementById('interfaceWrapper') ||
                images[i].parentNode == document.getElementById(view[0]) ||
                images[i].parentNode == document.getElementById(view[1]) ||
                document.getElementById('imageSlider').contains(images[i]))) {
            for (j = 0; j < images.length; j++) {
                if (images[j].classList.contains('selected') && images[j].classList.contains(userId)) {
                    unMarkImageAsSelected3d(userId, images[j]);
                }
            }
            markImageAsSelected(userId, images[i]);
            found = true;
        }
    }
    if (found == false) {
        for (j = 0; j < images.length; j++) {
            unMarkImageAsSelected3d(userId, images[j]);
        }
    }
}

//transforms the selected image
function transformImage(userId, scale, angle, direction, phase) {
    if (document.getElementsByClassName('images selected ' + userId).length > 0) {
        hideMouse(userId);
        var selected = document.getElementsByClassName('images selected ' + userId)[0];
        newScale = scales[selected.id] + scale;
        angles[selected.id] = (direction * (1 - angle));

        if (phase == 'End') {
            scales[selected.id] = newScale;
            if (scales[selected.id] > maxScale) {
                scales[selected.id] = maxScale
            }
            if (scales[selected.id] < minScale) {
                scales[selected.id] = minScale
            }
        }
        selected.style.webkitTransform =
            selected.style.transform =
            'rotate(' + angles[selected.id] + 'deg) scale(' + newScale + ')';
        selected.style.webkitFilter = 'blur(0)';

    }
}

//swipes in a specific direction indicated by an integer
function swipeTo(userId, direction) {
    if (document.getElementsByClassName('selected ' + userId + ' grabbed')[0] == null) {
        switch (direction) {
            case 0:
                $('#magazine').turn('next');
                view = $('#magazine').turn('view');
                break;
            case 1:
                if (swipeSlideAmount == 1) {
                    $('.imageSlider').slick('slickNext');
                } else {
                    var newSlide;
                    if ((currSlide - swipeSlideAmount) < 0) {
                        newSlide = (slideCount + (currSlide - swipeSlideAmount)) % slideCount;
                    } else {
                        newSlide = (currSlide - swipeSlideAmount);
                    }
                    $('.imageSlider').slick('slickGoTo', newSlide);
                }
                break;
            case 2:
                $('#magazine').turn('previous');
                view = $('#magazine').turn('view');
                break;
            case 3:
                if (swipeSlideAmount == 1) {
                    $('.imageSlider').slick('slickPrev');
                } else {
                    var newSlide = (currSlide + swipeSlideAmount) % slideCount;
                    $('.imageSlider').slick('slickGoTo', newSlide);
                }
                break;
        }
    }
}

//moves the mouse to x,y
function moveMouse(userId, x, y) {
    var mouse = document.getElementById('mouse-' + userId);
    showMouse(userId);
    mouse.src = 'images/mouse/ho-' + getMouseColor(mouse.id).substr(1) + '.png';
    x = correctXValue(x);
    y = correctYValue(y);
    mouse.style.top = (y - (mouseSize/2)) + 'px';
    mouse.style.left = (x - (mouseSize/2)) + 'px';
    mouse.parentNode.appendChild(mouse);
}

//checks if mouse is on an image that can be dragged
function dragMoveMouse(userId, x, y, phase) {
    x = correctXValue(x);
    y = correctYValue(y);
    var mouse = document.getElementById('mouse-' + userId);
    showMouse(userId);
    mouse.src = 'images/mouse/hc-' + getMouseColor(mouse.id).substr(1) + '.png';
    var xChange = x - (parseInt(mouse.style.left) + (mouseSize/2));
    var yChange = y - (parseInt(mouse.style.top) + (mouseSize/2));
    mouse.style.top = (y - (mouseSize/2)) + 'px';
    mouse.style.left = (x - (mouseSize/2)) + 'px';
    if (phase == 'Grab') {
        selectImage(userId, x, y);
        if (document.getElementsByClassName('selected ' + userId)[0] != null) {
            document.getElementsByClassName('selected ' + userId)[0].className = 'images selected ' + userId + ' grabbed';
            if (document.getElementsByClassName('selected ' + userId)[0].parentNode.classList.contains('slick-slide')) {
                var image = document.getElementsByClassName('selected ' + userId)[0];
                var imageId = $(image.parentNode).attr('data-slick-index');
                var imageDimensions = image.getBoundingClientRect();

                $('.imageSlider').slick('slickRemove', imageId).slick('refresh');
                image.style.position = 'absolute';
                image.style.left = imageDimensions.left + 'px';
                image.style.top = imageDimensions.top + 'px';
                image.style.zIndex = 15;
                document.getElementById('interfaceWrapper').appendChild(image);
            }
        }
    }
    if (document.getElementsByClassName(userId + ' grabbed')[0] != null) {
        moveImage(document.getElementsByClassName(userId + ' grabbed')[0], xChange, yChange);
        if (phase == 'Release') {
            if (document.getElementsByClassName(userId + ' grabbed')[0] != null) {
                document.getElementsByClassName(userId + ' grabbed')[0].className = 'images selected ' + userId;
                var image = document.getElementsByClassName('selected ' + userId)[0]
                var carouselDimensions = document.getElementById('imageSlider').getBoundingClientRect();
                var deletionAreaDimensions = document.getElementById('deletionAreaWrapper').getBoundingClientRect();
                if (x > carouselDimensions.left &&
                    x < carouselDimensions.left + parseInt(carouselDimensions.width) &&
                    y > carouselDimensions.top &&
                    y < carouselDimensions.top + parseInt(carouselDimensions.height)) {
                    document.getElementById('interfaceWrapper').removeChild(image);
                    addImage(image.id);
                }
                if (x > deletionAreaDimensions.left &&
                    x < deletionAreaDimensions.left + parseInt(deletionAreaDimensions.width) &&
                    y > deletionAreaDimensions.top &&
                    y < deletionAreaDimensions.top + parseInt(deletionAreaDimensions.height)) {
                    deleteFile(image.id);
                    document.getElementById('interfaceWrapper').removeChild(image);
                }
            }
        }
    }
}

//moves the mouse to x,y
function dragMouse(userId, x, y) {
    var mouse = document.getElementById('mouse-' + userId);
    mouse.src = 'images/mouse/cursor-' + getMouseColor(mouse.id).substr(1) + '.png';
    mouse.parentNode.appendChild(mouse);
}

//moves an image to x,y
function moveImage(img, x, y) {
    img.style.left = (parseInt(img.style.left) + x) + 'px';
    img.style.top = (parseInt(img.style.top) + y) + 'px';
    var targetDimensions = img.getBoundingClientRect();
    var magazine = document.getElementById('magazine');
    var magazineDimensions = magazine.getBoundingClientRect();
    var parent = img.parentNode;
    document.getElementById('interfaceWrapper').appendChild(img)

    if (parent == document.getElementById(view[0])) {
        img.style.left = (parseInt(img.style.left) + magazineDimensions.left) + 'px';
        img.style.top = (parseInt(img.style.top) + magazineDimensions.top) + 'px';
    }
    if (parent == document.getElementById(view[1])) {
        img.style.left = (parseInt(img.style.left) + magazineDimensions.left + parseInt(magazineDimensions.width) / 2) + 'px';
        img.style.top = (parseInt(img.style.top) + magazineDimensions.top) + 'px';
    }

    if (document.getElementById(view[0]) != null &&
        parseInt(targetDimensions.left) > magazineDimensions.left &&
        parseInt(targetDimensions.left) < (magazineDimensions.left + (parseInt(magazine.style.width) / 2) - parseInt(targetDimensions.width)) &&
        parseInt(targetDimensions.top) < (magazineDimensions.top + parseInt(magazine.style.height) - parseInt(targetDimensions.height)) &&
        parseInt(targetDimensions.top) > magazineDimensions.top) {
        img.style.left = parseFloat(img.style.left) - magazineDimensions.left + 'px';
        img.style.top = parseFloat(img.style.top) - magazineDimensions.top + 'px';
        document.getElementById(view[0]).appendChild(img);
    } else if (document.getElementById(view[1]) != null &&
        (parseInt(targetDimensions.left) > (magazineDimensions.left + parseInt(magazine.style.width) / 2)) &&
        parseInt(targetDimensions.left) < (magazineDimensions.left + parseInt(magazine.style.width) - parseInt(targetDimensions.width)) &&
        parseInt(targetDimensions.top) < (magazineDimensions.top + parseInt(magazine.style.height) - parseInt(targetDimensions.height)) &&
        parseInt(targetDimensions.top) > magazineDimensions.top) {
        img.style.left = (parseFloat(img.style.left) - (magazineDimensions.left + (parseInt(magazine.style.width) / 2))) + 'px';
        img.style.top = (parseFloat(img.style.top) - magazineDimensions.top) + 'px';
        document.getElementById(view[1]).appendChild(img);
    } else {
        document.getElementById('interfaceWrapper').appendChild(img);


    }
}

