function addPage() {
    var newDiv = document.createElement('div');
    pageCount = pageCount + 1;
    newDiv.id = pageCount;
    newDiv.className = 'magazine-page';
    if (pageCount % 2 == 0) {
        newDiv.innerHTML = '<span class=\'evenPage\'>' + pageCount + '</span>';
    } else {
        newDiv.innerHTML = '<span class=\'oddPage\'>' + pageCount + '</span>';
    }
    $('#magazine').turn('addPage', newDiv, pageCount);
    newDiv.style.backgroundImage = 'url(images/backgrounds/blank-page.png)';
    var newDiv2 = document.createElement('div');
    pageCount = pageCount + 1;
    newDiv2.id = pageCount;
    newDiv2.className = 'magazine-page';
    if (pageCount % 2 == 0) {
        newDiv2.innerHTML = '<span class=\'evenPage\'>' + pageCount + '</span>';
    } else {
        newDiv2.innerHTML = '<span class=\'oddPage\'>' + pageCount + '</span>';
    }
    $('#magazine').turn('addPage', newDiv2, pageCount);
    newDiv2.style.backgroundImage = 'url(images/backgrounds/blank-page.png)';
    view = $('#magazine').turn('view');
}

function removePage() {
    if (pageCount == parseInt(view[0]) || pageCount == parseInt(view[1])) {
        $('#magazine').turn('previous');
        $('#magazine').turn('previous');
    }
    if (pageCount > 2) {
        $('#' + pageCount).children('.images').each(function() {
            addImage($(this).attr('id'))
        });
        $('#magazine').turn('removePage', pageCount);
        pageCount = pageCount - 1;
        $('#' + pageCount).children('.images').each(function() {
            addImage($(this).attr('id'))
        });
        $('#magazine').turn('removePage', pageCount);
        pageCount = pageCount - 1;
        view = $('#magazine').turn('view');
    }
}

function correctXValue(x) {
    var bodyBox = document.body.getBoundingClientRect();
    if (x < 0) x = mouseSize/2;
    if (x > parseInt(bodyBox.width) - mouseSize) x = parseInt(bodyBox.width) - mouseSize/2;
    return x;
}

function correctYValue(y) {
    var bodyBox = document.body.getBoundingClientRect();
    if (y < 0) y = mouseSize/2;
    if (y > parseInt(bodyBox.height) - mouseSize) y = parseInt(bodyBox.height) - mouseSize/2;
    return y;
}

